export const ORDER_STATUS = {
  open: 'open',
  approved: 'approved',
  confirmed: 'confirmed',
  sent: 'sent',
  completed: 'completed',
  cancelled: 'cancelled',
};

export const ORDER_STATUS_FLOW = [
  ORDER_STATUS.open,
  ORDER_STATUS.approved,
  ORDER_STATUS.confirmed,
  ORDER_STATUS.sent,
  ORDER_STATUS.completed,
  ORDER_STATUS.cancelled,
];
